import React, { Component } from 'react';

const tempValue = {
    "image": "https://placeimg.com/64/64/1"
}

class Home extends Component {
    render(){
        return(
            <div>
                <h1 class="home-title">Date Mate</h1>
                <div class="home-search-bar">
                    <img class="home-search-icon" src={tempValue.image} alt="search-icon"/>
                    <input class="home-search-text" type="text"/>
                    <img class="home-search-icon" src={tempValue.image} alt="search-icon"/>
                </div>
            </div>
        )
    }
}

export default Home;
